function adjust_block_image(image){var image_wrapper=image.parent();var image_width_original=0;var image_height_original=0;if(image.data('width-original')===undefined){if(image.attr("src")!=null){$("<img/>").attr("src",image.attr("src")).load(function(){image.data('width-original',this.width);image.data('height-original',this.height);adjust_block_image(image);});}}else{image_width_original=image.data('width-original');image_height_original=image.data('height-original');var image_width_new=image_wrapper.width();var image_height_new=image_height_original*(image_width_new/image_width_original);if(image_height_new<image_wrapper.height()){var image_height_new=image_wrapper.height();var image_width_new=image_width_original*(image_height_new/image_height_original);}
var image_margin_left=-(image_width_new/2);var image_margin_top=-(image_height_new/2);image.css({'position':'absolute','left':'50%','top':'50%','width':image_width_new,'height':image_height_new,'marginLeft':image_margin_left,'marginTop':image_margin_top,});}}
